            "\uae08\uc561 \uad6c\uac04 \uc124\uc815 \uc624\ub958": "\uae08\uc561 \uad6c\uac04 \uc124\uc815\uc774 \uc798\ubabb\ub418\uc5c8\uc2b5\ub2c8\ub2e4. \uc88c\uce21\uc758 \uae08\uc561\uc740 \uc6b0\uce21\uc758 \uae08\uc561\ubcf4\ub2e4 \ud074 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4.",
            "\uc870\ud68c\uad8c\ud55c\uc5c6\uc74c": "\ube44\uacf5\uac1c \ubb38\uc11c\uc758 \uacbd\uc6b0, \ud574\ub2f9 \ubb38\uc11c\uc758 \uacb0\uc7ac\uc790, \ucc38\uc870\uc790\ub9cc \uc5f4\ub78c\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
            "\uc2dc\uc2a4\ud15c\uacfc \uc5f0\ub3d9\ub41c \ubb38\uc11c\ub294 \ubb38\uc11c \ud68c\uc218\uac00 \ubd88\uac00\ub2a5\ud569\ub2c8\ub2e4.": "\uc2dc\uc2a4\ud15c\uacfc \uc5f0\ub3d9\ub41c \ubb38\uc11c\ub294 \ubb38\uc11c \ud68c\uc218\uac00 \ubd88\uac00\ub2a5\ud569\ub2c8\ub2e4.",
            "\ubc18\ub824\ub97c \uc694\uccad\ud558\uc2dc\uac70\ub098 \ubb38\uc11c \ub2f4\ub2f9\uc790\uc5d0\uac8c \ubb38\uc758\ud574 \uc8fc\uc138\uc694.": "\ubc18\ub824\ub97c \uc694\uccad\ud558\uc2dc\uac70\ub098 \ubb38\uc11c \ub2f4\ub2f9\uc790\uc5d0\uac8c \ubb38\uc758\ud574 \uc8fc\uc138\uc694.",
            "\uc2dc\uc2a4\ud15c\uacfc \uc5f0\ub3d9\ub41c \ubb38\uc11c\ub294 \uc7ac\uae30\uc548\uc774 \ubd88\uac00\ub2a5\ud569\ub2c8\ub2e4.": "\uc2dc\uc2a4\ud15c\uacfc \uc5f0\ub3d9\ub41c \ubb38\uc11c\ub294 \uc7ac\uae30\uc548\uc774 \ubd88\uac00\ub2a5\ud569\ub2c8\ub2e4.",
