            "\uacb0\uc7ac \uc815\ubcf4 \uc124\uc815 \ubc0f \uc694\uccad": "\uacb0\uc7ac \uc815\ubcf4 \uc124\uc815 \ubc0f \uc694\uccad",
            "\uc77c\uad04\uc811\uc218 \ud31d\uc5c5\uc124\uba85": "\uae30\uc9c0\uc815\ub41c \uc218\uc2e0 \ubb38\uc11c \ub2f4\ub2f9\uc790\uc640 \uad00\uacc4\uc5c6\uc774 <br>\uc120\ud0dd\ud55c \ubaa8\ub4e0 \ubb38\uc11c\uac00 \uc77c\uad04 \uc811\uc218\ub429\ub2c8\ub2e4.<br><strong class='nega'>\uc77c\uad04 \uc811\uc218 \ud558\uc2dc\uaca0\uc2b5\ub2c8\uae4c?</strong>",
            "{{arg1}}\uac74\uc758 \ubb38\uc11c\uac00 \uc811\uc218\ub418\uc5c8\uc2b5\ub2c8\ub2e4. \uc811\uc218 \ud0ed\uc5d0\uc11c \ud655\uc778\ud558\uc138\uc694.": "{{arg1}}\uac74\uc758 \ubb38\uc11c\uac00 \uc811\uc218\ub418\uc5c8\uc2b5\ub2c8\ub2e4. <br>\uc811\uc218 \ud0ed\uc5d0\uc11c \ud655\uc778\ud558\uc138\uc694.",
