            "{{arg1}}\uac74\uc758 \ubb38\uc11c\uac00 \uc811\uc218\uac00 \ucde8\uc18c\ub418\uc5c8\uc2b5\ub2c8\ub2e4.": "{{arg1}}\uac74\uc758 \ubb38\uc11c\uac00 \uc811\uc218\uac00 \ucde8\uc18c\ub418\uc5c8\uc2b5\ub2c8\ub2e4.<br>\uc811\uc218 \ucde8\uc18c\ub41c \ubb38\uc11c\ub294 \uc811\uc218\ub300\uae30 \ud0ed\uc5d0\uc11c \ud655\uc778\ud558\uc138\uc694.",
            "\ub2f4\ub2f9\uc790 \uc77c\uad04 \uc9c0\uc815": "\ub2f4\ub2f9\uc790 \uc77c\uad04 \uc9c0\uc815",
            "\ub2f4\ub2f9\uc790 \uc77c\uad04\uc9c0\uc815 \ud31d\uc5c5\uc124\uba85": "\ubb38\uc11c \uc885\ub958\uc5d0 \uad00\uacc4\uc5c6\uc774 \uc120\ud0dd\ud55c \ubaa8\ub4e0 \ubb38\uc11c\uc758 \ub2f4\ub2f9\uc790\uac00 \uc77c\uad04 \uc9c0\uc815\ub429\ub2c8\ub2e4.<br> \ub610\ud55c \uc774\ubbf8 \ub2f4\ub2f9\uc790\uac00 \uc9c0\uc815\ub41c \ubb38\uc11c\ub3c4 \uc77c\uad04\uc9c0\uc815\uc2dc \ub2f4\ub2f9\uc790\uac00 \ubcc0\uacbd\ub418\ub2c8 \uc720\uc758\ud558\uc2dc\uae30 \ubc14\ub78d\ub2c8\ub2e4. <br>\uc218\uc2e0 \ubb38\uc11c\ub97c \uc811\uc218 \ud560 \ubd80\uc11c\uc6d0\uc744 \uc9c0\uc815\ud558\uc138\uc694.",
            "{{arg1}} \uc77c\uad04\uc9c0\uc815 \uacbd\uace0": "{{arg1}}\uc740(\ub294) \ubb38\uc11c\uc758 \uc218\uc2e0\ubd80\uc11c\uc5d0 \ub530\ub77c \uc9c0\uc815\uc774 \uac00\ub2a5\ud558\ubbc0\ub85c \uc218\uc2e0\ubd80\uc11c\ubcc4\ub85c \ubb38\uc11c\ub97c \ubd84\ub958\ud558\uc5ec \ucc98\ub9ac\ud558\uc2dc\uae30 \ubc14\ub78d\ub2c8\ub2e4.",
            "{{arg1}}\uac74\uc758 \ubb38\uc11c\uc5d0 \ub2f4\ub2f9\uc790\uac00 \uc9c0\uc815\ub418\uc5c8\uc2b5\ub2c8\ub2e4.": "{{arg1}}\uac74\uc758 \ubb38\uc11c\uc5d0 \ub2f4\ub2f9\uc790\uac00 \uc9c0\uc815\ub418\uc5c8\uc2b5\ub2c8\ub2e4.",
            "\uc77c\uad04 \uc218\uc2e0 \uacb0\uc7ac \uacbd\uace0": "\ubcf8\uc778\uc774 \ub2f4\ub2f9\uc790\ub85c \uc9c0\uc815\ub41c \uc218\uc2e0 \ubb38\uc11c\ub9cc<br>\uacb0\uc7ac \uc815\ubcf4 \uc124\uc815 \ubc0f \uc694\uccad\uc774 \uac00\ub2a5\ud569\ub2c8\ub2e4. <br>\ub2f4\ub2f9\uc790 \uac80\uc0c9\uc73c\ub85c \ucc98\ub9ac \uac00\ub2a5\ud55c \ubb38\uc11c \uc120\ud0dd\ud558\uc5ec <br>\uacb0\uc7ac\ub97c \uc9c4\ud589\ud558\uc2dc\uae30 \ubc14\ub78d\ub2c8\ub2e4.",
            "\uacb0\uc7ac\uc120 1\uc778\uacb0\uc7ac \uacbd\uace0": "1\uc778 \uacb0\uc7ac\ub97c \uc0ac\uc6a9\ud558\uc9c0 \uc54a\ub294 \ubb38\uc11c\uac00 \uc788\uc73c\ub2c8 <br>\uacb0\uc7ac \uc815\ubcf4 \uc124\uc815 \ud6c4 \uacb0\uc7ac \uc694\uccad \ud574\uc8fc\uc2dc\uac70\ub098, <br>\uacb0\uc7ac \uc591\uc2dd\ubcc4\ub85c \uc77c\uad04\ucc98\ub9ac \ud574\uc8fc\uc2dc\uae30 \ubc14\ub78d\ub2c8\ub2e4.",
            "{{arg1}}\uac74\uc758 \uacb0\uc7ac\uac00 \uc694\uccad\ub418\uc5c8\uc2b5\ub2c8\ub2e4.": "{{arg1}}\uac74\uc758 \uacb0\uc7ac\uac00 \uc694\uccad\ub418\uc5c8\uc2b5\ub2c8\ub2e4.<br>\uacb0\uc7ac\uc694\uccad\ub41c \ubb38\uc11c\uac00 \ub9ce\uc740 \uacbd\uc6b0 \ud574\ub2f9 \ubaa9\ub85d\uc5d0\uc11c \uc218 \ubd84\uac04 \ubcf4\uc5ec\uc9c8 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
            "\uc77c\uad04\uacb0\uc7ac\uc694\uccad": "\uc77c\uad04 \uacb0\uc7ac \uc694\uccad",
