            "\ubaa8\ub4e0 \uacb0\uc7ac \uad8c\ud55c \uc0ac\uc6a9\uc790": "\ubaa8\ub4e0 \uacb0\uc7ac \uad8c\ud55c \uc0ac\uc6a9\uc790",
            "\uc77c\ubd80 \uacb0\uc7ac \uad8c\ud55c \uc0ac\uc6a9\uc790": "\uc77c\ubd80 \uacb0\uc7ac \uad8c\ud55c \uc0ac\uc6a9\uc790",
