            "\uc6d0\ubb38\uc11c \uc0ad\uc81c \ubd88\uac00 \uba54\uc2dc\uc9c0": "\ubb38\uc11c\ubc88\ud638 ''{{arg1}}'' ''{{arg2}}'' (\uc640)\uacfc \uc5f0\uacb0\ub41c \uc218\uc2e0\ubb38\uc11c\uac00 \uc788\uc5b4 \uc0ad\uc81c\ud560 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4. <br>\uc218\uc2e0 \ubb38\uc11c\ub97c \uba3c\uc800 \uc0ad\uc81c\ud558\uc2e0 \ub4a4\uc5d0 \ud574\ub2f9 \ubb38\uc11c\ub97c \uc0ad\uc81c\ud574\uc8fc\uc138\uc694.",
            "\uc5f0\ub3d9\ubb38\uc11c \uc0ad\uc81c \ubd88\uac00 \uba54\uc2dc\uc9c0": "\ubb38\uc11c\ubc88\ud638 ''{{arg1}}'' ''{{arg2}}'' (\uc740)\ub294 \uc2dc\uc2a4\ud15c\uacfc \uc5f0\ub3d9\ub41c \ubb38\uc11c\uc785\ub2c8\ub2e4. <br>\uac19\uc740 \ub0b4\uc6a9\uc73c\ub85c \uc7ac\uae30\uc548 \ud558\ub824\uba74 \ubc18\ub4dc\uc2dc [\uac15\uc81c\ubc18\ub824] \ud6c4 \uc0ad\uc81c\ud558\uc154\uc57c \ud569\ub2c8\ub2e4. <br>\ub610\ud55c \uc77c\uad04 \uc0ad\uc81c\ub294 \ubd88\uac00\ub2a5\ud558\uc624\ub2c8 \uac1c\ubcc4 \uc0ad\uc81c \ucc98\ub9ac \ud574\uc8fc\uc2dc\uae30 \ubc14\ub78d\ub2c8\ub2e4.",
            "\uc120\ud0dd\ud55c \uadf8\ub8f9\uc73c\ub85c \uc5f4\ub78c\uc790\ub97c \uc9c0\uc815\ud560 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4.": "\uc120\ud0dd\ud55c \uadf8\ub8f9\uc73c\ub85c \uc5f4\ub78c\uc790\ub97c \uc9c0\uc815\ud560 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4.",
