            "\ucee4\ubba4\ub2c8\ud2f0 \ub313\uae00 \ub4f1\ub85d\uc790 \uc124\uba85": "\ub313\uae00 \ub4f1\ub85d\uc790 : \ub0b4\uac00 \ub313\uae00\uc744 \ub4f1\ub85d\ud55c \ub4a4\uc5d0 \uc0c8\ub85c\uc6b4 \ub313\uae00\uc774 \ub4f1\ub85d\ub418\uba74 \uc54c\ub9bc\ubc1b\uc74c",
            "\ucee4\ubba4\ub2c8\ud2f0 \ucd94\ucc9c \ub4f1\ub85d\uc790 \uc124\uba85": "\uac8c\uc2dc\ubb3c \ub4f1\ub85d\uc790 : \ub0b4\uac00 \ub4f1\ub85d\ud55c \uac8c\uc2dc\ubb3c\uc5d0 '+1'\uc774 \ub4f1\ub85d\ub418\uba74 \uc54c\ub9bc\ubc1b\uc74c",
