            "\ud22c\ub450 \ub313\uae00\ub4f1\ub85d \uc990\uaca8\ucc3e\uae30 \uc124\uba85": "\uc990\uaca8\ucc3e\uae30 : \ub0b4\uac00 \uc990\uaca8\ucc3e\uae30\ub85c \uc124\uc815\ud55c \ubcf4\ub4dc\uc5d0\uc11c \uce74\ub4dc\uc5d0 \ub313\uae00\uc774 \ub4f1\ub85d\ub418\uba74 \uc54c\ub9bc\ubc1b\uc74c",
