            "\ud22c\ub450 \uc138\ubd80\uc791\uc5c5\ucd94\uac00 \ub2f4\ub2f9\uc790 \uc124\uba85": "\ub2f4\ub2f9\uc790 : \ub0b4\uac00 \ub2f4\ub2f9\uc790\ub85c \ub418\uc5b4\uc788\ub294 \uce74\ub4dc\uc5d0 \uc138\ubd80\uc791\uc5c5\uc774 \ucd94\uac00\ub418\uba74 \uc54c\ub9bc\ubc1b\uc74c",
