            "\ud22c\ub450 \uce74\ub4dc\ub4f1\ub85d \uc6b4\uc601\uc790 \uc124\uba85": "\uc6b4\uc601\uc790 : \ub0b4\uac00 \uc6b4\uc601\uc790\ub85c \ub418\uc5b4\uc788\ub294 \ubcf4\ub4dc\uc5d0\uc11c \uce74\ub4dc\uac00 \ub4f1\ub85d\ub418\uba74 \uc54c\ub9bc\ubc1b\uc74c",
            "\ud22c\ub450 \uce74\ub4dc\ub4f1\ub85d \uc990\uaca8\ucc3e\uae30 \uc124\uba85": "\uc990\uaca8\ucc3e\uae30 : \ub0b4\uac00 \uc990\uaca8\ucc3e\uae30\ub85c \uc124\uc815\ud55c \ubcf4\ub4dc\uc5d0\uc11c \uce74\ub4dc\uac00 \ub4f1\ub85d\ub418\uba74 \uc54c\ub9bc\ubc1b\uc74c",
            "\uce98\ub9b0\ub354 \uc804\uc0ac\uc77c\uc815 \ucc38\uc11d\uc790 \uc124\uba85": "\ucc38\uc11d\uc790 : \uc804\uc0ac \uc77c\uc815\uc5d0 \uc77c\uc815\uc774 \ub4f1\ub85d\ub418\uba74 \uc54c\ub9bc \ubc1b\uc74c",
            "\uce98\ub9b0\ub354 \uc77c\uc815\ub4f1\ub85d \ucc38\uc11d\uc790 \uc124\uba85": "\ucc38\uc11d\uc790 : \ucc38\uc11d\uc790\ub85c \ud3ec\ud568\ub418\uba74 \uc54c\ub9bc \ubc1b\uc74c",
            "\uce98\ub9b0\ub354 \uc77c\uc815\uc218\uc815 \ucc38\uc11d\uc790 \uc124\uba85": "\ucc38\uc11d\uc790 : \ucc38\uc11d\uc790\ub85c \ud3ec\ud568\ub41c \uc77c\uc815\uc774 \uc218\uc815\ub418\uba74 \uc54c\ub9bc \ubc1b\uc74c",
